import { BrowserRouter as Router, Routes as Switch, Route, Navigate } from "react-router-dom";

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/" element={<p>LOL</p>}/>
            </Switch>
        </Router>
    )
};

export default App;
